const Post = (props) => {
    return (
        <div className="post">
            <div className="post__cont">
                <h3>{props.post.id} {props.post.title}</h3>
                <div>
                    This language is not as easy as I thought it would be.....
                </div>
            </div>
            <div className="post__buttons">
                <button>Delete</button>
            </div>
        </div>
    );
};

export default Post;
